      b 24.10.1952
      Kerry b. at Waipiro Bay. Charles, s/o Conway Seymour and Louisa Parker. Address: "Kohata",
      Whangara, Gisborne.
      Kerry was educated at Queenswood School, Rudolf Steiner School and Woodford House. She is a
      kindergarten teacher and has been involved in different aspects of early childhood education in the
      Gisborne area. She is currently at home with small children.
      Charles was educated at Hereworth School and Wanganui Collegiate School. He has farmed in Hawkes
      Bay and currently runs the family farm with deer, sheep and cattle. Kerry and Charles have both
      travelled overseas to USA and Britain.
